// fixed window oracle that recomputes the average price for the entire period once every period
// note that the price average is only guaranteed to be over at least 1 period, but may be over a longer period
contract Oracle {
    using FixedPoint for *;
    address dev_address;
    uint public PERIOD = 60 seconds;

    struct tokenInfo {
        IUniswapV2Pair pair;
        address token0;
        address token1;
        uint price0CumulativeLast;
        uint price1CumulativeLast;
        uint32 blockTimestampLast;
        FixedPoint.uq112x112 price0Average;
        FixedPoint.uq112x112 price1Average;
    }
    mapping(address => tokenInfo) public tokenInfoList;
    FixedPoint.uq112x112 public price0Average;
    FixedPoint.uq112x112 public price1Average;
    address public factory = 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f;

    constructor() public {
        dev_address = msg.sender;
    }

    function setNewTokenInfo(address tokenA, address tokenB) public onlyOwner {
        IUniswapV2Pair _pair = IUniswapV2Pair(UniswapV2Library.pairFor(factory, tokenA, tokenB));
        //find tokenA price
        tokenInfo storage info = tokenInfoList[tokenA];
        info.pair = _pair;
        info.token0 = _pair.token0();
        info.token1 = _pair.token1();
        info.price0CumulativeLast = _pair.price0CumulativeLast();
        info.price1CumulativeLast = _pair.price1CumulativeLast();
        uint112 reserve0;
        uint112 reserve1;
        (reserve0, reserve1, info.blockTimestampLast) = _pair.getReserves();
        require(reserve0 != 0 && reserve1 != 0, "ExampleOracleSimple: NO_RESERVES");
    }

    modifier onlyOwner() {
        require(dev_address == msg.sender, "Ownable: caller is not the ererer");
        _;
    }

    function update(address token) external {
        tokenInfo storage info = tokenInfoList[token];
        require(address(info.pair) != address(0), "token is not init success");
        (uint price0Cumulative, uint price1Cumulative, uint32 blockTimestamp) = UniswapV2OracleLibrary.currentCumulativePrices(address(info.pair));
        uint32 timeElapsed = blockTimestamp - info.blockTimestampLast; // overflow is desired

        // ensure that at least one full period has passed since the last update
        require(timeElapsed >= PERIOD, "ExampleOracleSimple: PERIOD_NOT_ELAPSED");

        // overflow is desired, casting never truncates
        // cumulative price is in (uq112x112 price * seconds) units so we simply wrap it after division by time elapsed
        info.price0Average = FixedPoint.uq112x112(uint224((price0Cumulative - info.price0CumulativeLast) / timeElapsed));
        info.price1Average = FixedPoint.uq112x112(uint224((price1Cumulative - info.price1CumulativeLast) / timeElapsed));

        info.price0CumulativeLast = price0Cumulative;
        info.price1CumulativeLast = price1Cumulative;
        info.blockTimestampLast = blockTimestamp;
    }

    // note this will always return 0 before update has been called successfully for the first time.
    function consult(address token, uint amountIn) external view returns (uint amountOut) {
        tokenInfo memory info = tokenInfoList[token];
        require(address(info.pair) != address(0), "token is not init success");
        if (token == info.token0) {
            amountOut = info.price0Average.mul(amountIn).decode144();
        } else {
            require(token == info.token1, "ExampleOracleSimple: INVALID_TOKEN");
            amountOut = info.price1Average.mul(amountIn).decode144();
        }
    }

    function setPERIOD(uint amount) public onlyOwner {
        PERIOD = (1 hours) * (amount);
    }
}
